# GFS Chiclet Definitions
#
# This file is used to define most options/settings for the chiclets
# and to configure settings for individual domains.
import sys, datetime
#sys.path.append('C:\Users\Matthew\AppData\Local\Enthought\Canopy32\User\Lib\site-packages\matplotlib')
#import colormaps as cmaps #needed on home desktop from outdated matplotlib


##### OPTIONS AND SETTINGS #####

# Set the workspace
# basedir
# Primary directory housing data archive, output, logs, etc.
##basedir='C:\\Users\\StaloyT\\GFSChics\\'
basedir='/usr/local/ldm/util/GFS.Chiclets/'

# Send email at the end?
# email_flag
# 'y' or 'n'
email_flag='n'

# Set email message text. Should be preceeded by 4 spaces for indent.
txtmsg='    8/8/17:\n\
        Adjustments made to Tropical Chiclet sensitivity.\n\
        IVT color scale changed lower bound from 0 to 250.\n\n\
    7/27/17:\n\
        Chiclets are BACK!\n\n\
        A major overhaul to the GFS data processing techniques should prevent\n\
        prolonged chiclet outages from GFS upgrades in the future.\n\n\
        Changes with this update:\n\
            "Grid point count" charts changed to percentage of points instead of raw count.\n\
            Temperature anomaly colorbar reduced to +/-15 from +/-20.\n\
            Domain image included on charts and no longer sent separately.\n\
            NEW CHARTS added: Integrated Vapor Transport and Tropical Cyclone Detector.\n\
                See descriptions for details.'


# Chose real-time or archived run
# cur_run_str
# Set to 'live' for real-time run
# Set to 'YYYYMMDDHH' for archived run
cur_run_str='live'
#cur_run_str='2017072000'


# Set the data resolution
# grid_res
# lat/lon grid spacing in decimal degrees
# '0p25'    (0.25 deg, ~ 215 MB files)
# '0p50'    (0.50 deg,  ~ 65 MB files)
# '1p00'    (1.00 deg,  ~ 20 MB files)
# '2p50'    (2.50 deg,   ~ 4 MB files)  2.50 obsolete as of 7/20/17 ???
grid_res='1p00'


# Set the domain of ALL data to be archived
# master_domtup
# (ullat,ullon,lrlat,lrlon)
# decimal degrees, use (-) for south or west
# WARNING: must be evenly divisible by grid_res or fatal error will occur
master_domtup=(60,-135,10,-5)


# tropic_domtup
# Set domain for tropical detection chiclet
# (ullat,ullon,lrlat,lrlon)
tropic_domtup=(31,-98,21,-78)


##### SITE CONFIGURATION OVERRIDES #####

# Overrides will force ALL sites to use the override value rather than
# the individually configured setting.
# If override should not be used, set to empty string ''

override_Products='' #['ALL']

override_ProductsOmit='' #['IVT','TROPICAL']

override_clrdefault='' #'jet'


##### SITE CONFIGURATION #####
# SiteDict Parameters
#
# domtup:       (ullat,ullon,lrlat,lrlon)
# email:        List of email recipients. wxchiclets MUST be included.
# clrdefault:   Color choice for gridpoint-based products (typically jet).
# PWdata:       Entries for jan-dec monthly climo PW moving average.
# Products:     List of products to email. Enter 'ALL' to send all products.
# ProductsOmit: List of products specifically to not to create for this site.
# TempCats:     Tuples of (min,max) for monthly temperature ranges from jan-dec (0 placeholder for month 0).
# NrmMins:      List of daily normal min temperatures.
# NrmMaxs:      List of daily normal max temperatures.
# FirePts:      Number of grid points to use for fire weather average.
# PrecipPts:    Number of grid points to use for accumulated precip average.
# etextsup:     Supplemental email text for the changes/additions section



