# Determine run time
now_tm=datetime.datetime.utcnow()
now_YYYYMMDD=now_tm.strftime('%Y%m%d')
now_hh=now_tm.strftime('%H')
now_mm=now_tm.strftime('%M')

if cur_run_str == 'live':
    # Determine what should be the most current run of the GFS availbale online.
    # If it's not available or the download fails, we will try 2 more times.
    if int(now_hh)>=17:
        cur_run_str=now_YYYYMMDD+'12'
    elif int(now_hh)>=11:
        cur_run_str=now_YYYYMMDD+'00' # 06 if including 06/18z runs, otherwise 00
    elif int(now_hh)>=5:
        cur_run_str=now_YYYYMMDD+'00'
    else:
        cur_run_str=(now_tm-datetime.timedelta(days=1)).strftime('%Y%m%d')+'12' # 18 if including 06/18z runs, otherwise 12
cur_run_tm=datetime.datetime.strptime(cur_run_str,'%Y%m%d%H')

# Set direct path to logfile
logpath=logdir+cur_run_str+'.txt'

